import React, { useState } from 'react';
import "./App.css"
import Flag from './navigation_bar/Flag.js';
import {Link, BrowserRouter, Route, Routes} from "react-router-dom";
import Home from './navigation_bar/Home';
import About from '../../new_project/src/About';

function App() {



  return (
    <BrowserRouter>
    <Routes>
      <Route path='/home' element={<Home/>}/>
      <Route   element={<App/>}/>

    </Routes>
    </BrowserRouter>


  );
}

export default App;
